export const constantRouterMap = [
    {
        path: '/login',
        name: 'login',
        component: () => import('@/views/login.vue'),
        hidden: true
    },
    {
        path: '*', // 错误路由
        redirect: '/404'
    },
    {
        path: '/404',
        component: () => import('@/views/404.vue'),
        hidden: true
    }
]
// 所有上面定义的路由都要写在下面的routers里
export const routers = [...constantRouterMap]
